import React from "react";
import Inactive from "../../assets/icons8-heart-50.png";
import Active from "../../assets/icons8-heart.gif";
import { height } from "@mui/system";


function ToggleLike({ active, handleChangeActive }) {
  return (
    <>
      <div className="toggle-wrapper">
        {active ? (
          <img
            className="active"
            src={Active}
            alt="yellow star"
            onClick={() => handleChangeActive()
            }
            height={30}
            width={30}
          />
        ) : (
          <img
            className="inactive"
            src={Inactive}
            alt="black and white star"
            onClick={() => handleChangeActive()}
          />
        )}
      </div>
    </>
  );
}

export default ToggleLike;
